import { createClient } from '@supabase/supabase-js';

const supabaseUrl = 'https://fnqfkanmkybhtclhogev.supabase.co';
const supabaseKey = process.env.REACT_APP_SUPABASE_KEY || '';

export const supabase = createClient(supabaseUrl, supabaseKey, {
  auth: {
    persistSession: true
  },
  storage: {
    // 添加 S3 配置
    s3Config: {
      accessKeyId: '7303e14cea3ab2e34fb7678204a376d5',
      secretAccessKey: '26975e5361d57e635e8f95cbe4bf5a6fdfc2180027e1809b813fcbb41cffc8e9',
      endpoint: 'https://fnqfkanmkybhtclhogev.supabase.co/storage/v1/s3',
      region: 'ap-southeast-1',
      forcePathStyle: true
    }
  }
});
